public static String getNearestAncestorUrl(StaplerRequest req,Object it) {
    List list = req.getAncestors();
    for( int i=list.size()-1; i>=0; i-- ) {
        Ancestor anc = (Ancestor) list.get(i);
        if(anc.getObject()==it)
            return anc.getUrl();
    }
    return null;
}

